// 페이지 공통부분 처리
import React from 'react'
import PropTypes from 'prop-types';
import 'antd/dist/antd.css'
import Head from 'next/head'

const App = ({ Component }) => {
    return (
        <>
        <Head>
            <meta charSet="utf-8"/>
            <title>Bluedot 블루닷 : 아티스트 브랜딩 콘텐츠 커뮤니티 플랫폼</title>
        </Head>


        <Component />

        </>
    )
};

App.propTypes = {
    Component: PropTypes.elementType.isRequired,
}

export default App;
